const st = {
  name: '',
  alias_name: '',
  splash_uri: '',
  splash_intro: ''
};
export default function profileReducer(actions = {TYPE:'default'}, state = st) {
  switch(actions.TYPE) {
    case 'default':
      return state;
    case 'SET_PROFILE':
      console.log(actions.payload);
    default:
      return state;
  }
}
